{
  "name": "UBX-NAV-TIMETRUSTED",
  "description": "External trusted time information",
  "class_id": "0x01",
  "message_id": "0x64",
  "message_type": "periodic_polled",
  "payload_length": {
    "fixed": 40
  },
  "fields": [
    {
      "byte_offset": 0,
      "data_type": "U1",
      "name": "version",
      "description": "Message version (0x01 for this version)",
      "fixed_value": 1
    },
    {
      "byte_offset": 1,
      "data_type": "U1",
      "name": "refSys",
      "description": "Reference time system (all the GNSS system supported by UBX-MGA-INI-TIME_GNSS except Glonass)",
      "values": {
        "0": "None",
        "1": "GPS Time",
        "2": "Galileo System Time (GST)",
        "3": "Beidou System Time (BDT)",
        "15": "NavIC System Time"
      }
    },
    {
      "byte_offset": 2,
      "data_type": "X1",
      "name": "valid",
      "description": "Validity Flags",
      "bit_fields": [
        {
          "bit_offset": 0,
          "bit_length": 1,
          "name": "trustedTime",
          "description": "1 = Valid initial and propagated trusted time (iniWno, iniTow, fIniTow, iniTAcc, propWno, propTow, fPropTow and propTAcc)"
        },
        {
          "bit_offset": 1,
          "bit_length": 1,
          "name": "deltaTimeValid",
          "description": "1 = Valid delta time (deltas and deltaMs) between current estimated time and the propagated trusted time"
        }
      ]
    },
    {
      "byte_offset": 3,
      "data_type": "U1",
      "name": "reserved0",
      "description": "Reserved",
      "reserved": true
    },
    {
      "byte_offset": 4,
      "data_type": "U4",
      "name": "iTOW",
      "unit": "ms",
      "description": "GPS time of week of the navigation epoch. See section iTOW timestamps in the integration manual for details."
    },
    {
      "byte_offset": 8,
      "data_type": "U2",
      "name": "iniWno",
      "description": "Initial week number"
    },
    {
      "byte_offset": 10,
      "data_type": "U2",
      "name": "propWno",
      "description": "Week number propagating the initial trusted time"
    },
    {
      "byte_offset": 12,
      "data_type": "U4",
      "name": "iniTow",
      "unit": "ms",
      "description": "Initial time of week"
    },
    {
      "byte_offset": 16,
      "data_type": "U4",
      "name": "propTow",
      "unit": "ms",
      "description": "Time of week propagating the initial trusted time"
    },
    {
      "byte_offset": 20,
      "data_type": "U4",
      "name": "iniTAcc",
      "unit": "ms",
      "description": "Initial Time Accuracy Estimate"
    },
    {
      "byte_offset": 24,
      "data_type": "U4",
      "name": "propTAcc",
      "unit": "ms",
      "description": "Propagated Time Accuracy Estimate"
    },
    {
      "byte_offset": 28,
      "data_type": "I4",
      "name": "deltas",
      "unit": "s",
      "description": "Integer seconds of delta time (current estimated time minus propagated trusted time)"
    },
    {
      "byte_offset": 32,
      "data_type": "I4",
      "name": "deltaMs",
      "unit": "ms",
      "description": "Integer milliseconds of delta time (current estimated time minus propagated trusted time)"
    },
    {
      "byte_offset": 36,
      "data_type": {
        "array_of": "U1",
        "count": 4
      },
      "name": "reserved1",
      "description": "Reserved",
      "reserved": true
    }
  ]
}
